import React, { useState, useEffect } from 'react'
import axios from 'axios'

// const HomePage = () => {
//     return (
//         <h1>Spaceagram</h1>

//     )
// }

function HomePage() {
    const [photos, setPhotos] = useState([])

    useEffect(() => {
        // rpf2PXcZhgOIA7Tjek38tFq5HDa7a5dsUgDiuVo1
        axios
        .get('https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?sol=10&api_key=rpf2PXcZhgOIA7Tjek38tFq5HDa7a5dsUgDiuVo1')

        .then( res => {
            console.log(res)
            setPhotos(res.data)
        })
        .catch( err => {
            console.log(err)
        })
    })
    return (
        <div>
            <h1>Spaceagram</h1>
             <ul>

             photos.map(photo => (<li key={photo.id}>pho</li>))

                {/* {
                    posts.map(post => (<li key={post.id}> {post.id} </li>
                    ))
                } */}
            </ul> 
        </div>
    )
}

export default HomePage
